import React, { Component } from "react";

function Card(props) {
  const data = props.Data;
  {
    data && console.log(data.data.data);
  }
  return (
    <>
      <div>
        {data &&
          data.data.data.map((items, index) => {
            return (
             <>
             <div><img src={items.avatar}/></div>
             <div>
                
             </div>
             </>
            );
          })}
      </div>
    </>
  );
}

export default Card;
